import '../home/home.css';
// import imagenFondo from '../../img/fondohome3.jpg';
import {  useDispatch, useSelector} from "react-redux";
import { useEffect, useState } from "react";
import {getAllRace, getAllTemperaments, orderByNameAz, orderByNameZa, filterCreated,orderByTemperaments, orderByPesoMin, orderByPesoMax,  } from '../../Redux/actions';
import Card from './Card/card';
import Searchbar from '../../components/searchbar/searchbar';
import { Link } from 'react-router-dom';
// import BarraArriba from '../../components/barraArriba/barraArriba';



export default function Home() {

const state = useSelector((state) => state.breed);
const dogtemperaments = useSelector ((state) => state.temperaments);
const dispatch = useDispatch();

useEffect (()=> {                   //me trae todas las razas
  dispatch (getAllRace())
  dispatch(getAllTemperaments())
}, [dispatch]) 


const [order, setOrder] = useState('')
const [page, setPage] = useState(1);


function hadleClick (e) {
    e.preventDefault ();
    dispatch(getAllRace())
};

function handleSortName(e){ 
    if(e.target.value === "Asc"){
        e.preventDefault ();
        dispatch (orderByNameAz(e.target.value));
        setPage (1);
        setOrder (`Ordenado ${e.target.value}`)
    }else if(e.target.value === "Desc"){
        e.preventDefault ();
        dispatch (orderByNameZa(e.target.value));
        setPage (1);
        setOrder (`Ordenado ${e.target.value}`)
    }else{

    }
}


function handleSortPeso(e){
    if(e.target.value === "Min"){
        e.preventDefault ();
        dispatch (orderByPesoMin(e.target.value));
        setPage (1);
        setOrder (`Ordenado ${e.target.value}`)
    }else if(e.target.value === "Max"){
        e.preventDefault ();
        dispatch (orderByPesoMax(e.target.value));
        setPage (1);
        setOrder (`Ordenado ${e.target.value}`)
    }else{

    }
}

function handleFilterCreated (e) {
    dispatch(filterCreated (e.target.value))
}

function handleTemperaments (e) { 
 console.log(e)
   dispatch(orderByTemperaments(e.target.value))

}




return (
    <div>
       <div>  

        <Searchbar/>

<button className="botonRefresh" onClick={hadleClick} >Volver a cargar todas las razas</button>

        </div>
        <div>

        <Link className="sinlinea" to='/create' id="click">
           <button className="buttonCreate"></button>
           <div className="textCrear">CREAR</div>
           <div className="textNR">nueva raza</div>
        </Link>

      </div>
      <div className="ubicTodos">
            <select  onChange={(e) => handleSortName (e)} className="ordenalf" >
                <option Value='All' selected="selected" hidden="hidden">Ordenar por orden alfab√©tico</option>
                <option Value= 'Asc'>A-Z</option>
                <option Value= 'Desc'>Z-A</option>
            </select>
            <select onChange={handleSortPeso}  className="peso">
                <option selected="selected" hidden="hidden">Ordenar por peso</option>
                <option defaultValue="Min">Min-Max</option>
                <option defaultValue="Max">Max-Min</option>
            </select>  
            <select onChange={ (e) =>handleTemperaments (e)} className="temperamentofil">
            <option selected="selected" hidden="hidden">Filtrar por temperamento</option>
            {dogtemperaments.map((t)=>(
                              <option key={t?.id} value={t?.name}>{t?.name}</option>
                           ))}
            </select>
            <select onChange={(e) => handleFilterCreated (e)} className="razafil">
                <option defaultvalue='All' selected="selected" hidden="hidden">Filtrar por raza</option>
                <option defaultvalue='Existentes'>Existentes</option>
                <option defaultvalue='Creadas'>Creadas</option>
            </select>           
            </div>   
{state.map((c)=>(
  <Card  image={c?.image} name={c?.name} temperament={c?.temperament} weight={c?.weight} /> 
))}


    </div>
  );
}
